import base64
import zlib
import json

# Your provided compressed payload
compressed_payload = ""

# Step 1: Decode the base64 payload
decoded_data = base64.b64decode(compressed_payload)

# Step 2: Decompress the decoded data using zlib
decompressed_data = zlib.decompress(decoded_data, wbits=zlib.MAX_WBITS|16)

# Step 3: Convert the decompressed data to a JSON object
json_data = json.loads(decompressed_data)

# Step 4: Extract and print the leaderboard data
leaderboard = json_data.get('leaderboard', [])
for entry in leaderboard:
    print(f"Name: {entry['name']}, Rank: {entry['rank']}, Score: {entry['score']}")
